VALUES
('FD7DC58E68A9447FB987460138FB3C85', 'deu', '★ 100. Giro d''Italia ★In Innichen ist dieses Jahr Start der 19. Etappe des  Giro d’’Italia. Die Fahrradelite trifft sich zur historischen 100. Ausgabe dieses Klassikers in den Dolomiten. Am Freitag 26. Mai 2017 kämpfen sich Radsportprofis der ganzen Welt von Innichen nach Sexten und über den Kreuzbergpass nach Sappada, Sella Chianzutan bis sie nach 191 Kilometern im 1290 m hoch liegenden Piancavallo eintreffen.08:30 Uhr Eröffnung Giro Village10:30 Uhr Präsentation Athleten'),
('FD7DC58E68A9447FB987460138FB3C85', 'eng', '★ 100th Giro d''Italia ★In San Candido starts the 19th stage of the Giro d''Italia 2017:San Candido/Innichen - Piancavallo (191km)8.30 a.m.: Opening Giro Village10.30 a.m.: Athletes Präsentation'),
('FD7DC58E68A9447FB987460138FB3C85', 'ita', '★ 100° Giro d''Italia ★San Candido e la bicicletta… una storia d’’amore infinita!Da molti anni San Candido ha un forte legame con il ciclismo. Molti turisti adorano i numerosi percorsi per mountain-bike e le ciclabili che passano tra le possenti montagne. I ciclisti qui si sentono a casa anche grazie alla calorosa ospitalità della popolazione.Dunque non c’’è da meravigliarsi se il nostro paesino sarà il punto di partenza della 19a tappa della 100a edizione del Giro d’’Italia. L’’élite del ciclismo si radunerà nelle Dolomiti per affrontare le tappe più difficili della 100a edizione di questo grande classico. Dalla Val di Fassa, passando da Ortisei fino ad arrivare da noi a San Candido!Venerdì, 26 maggio 2017 i ciclisti provenienti da tutto il mondo pedaleranno da San Candido verso Sesto, passeranno da Passo Monte Croce, Sella Chianzutan e raggiungeranno il traguardo dopo 191 km di fatica a Piancavallo, ad un’’altitudine di 1290 m.Il paese si tinge di rosa! Non perdetevi la partenza di questa tappa spettacolare che attraverserà le Dolomiti.Ore 08:30: Apertura Giro VillageOre 10:30: Presentazione atleti'),
('4231E17139FA49D0BA4C0503DB34E86B', 'deu', 'Bereits seit 100 Jahren gibt es im Marmordorf Laas einen Imkerverein. Dieses Jubiläum wird im Juli gefeiert!10 Uhr Feierlicher Gottesdienst in der Pfarrkirche St. Johannes, mit Segnung der VereinsfahneAnschließend Umzug mit der Laaser Böhmischen zum Festplatz beim Ausserloretzhof.Begrüßung durch den Vereins-Obmann Günther Tappeiner und Kurzbericht über das Vereinsgeschehen. Für Speis und Getränke wird bestens gesorgt. Zur musikalischen Unterhaltung spielen die "Laaser Böhmische" und ab 15 Uhr "Die Tengler" auf.'),
('4231E17139FA49D0BA4C0503DB34E86B', 'eng', 'Already for 100 years there is a beekeeper association in the marble village Lasa. This anniversary will be celebrated in July!10 am Holy mass in the parish church of St. John, with blessing of the club flag (in German language)Then parade with the group "Laaser Böhmische" to the fairground at the Ausserloretzhof.Festival with food and drinks as well as musical entertainment with the group "Laaser Böhmische" andfrom 3 pm with the group "Die Tengler".'),
('4231E17139FA49D0BA4C0503DB34E86B', 'ita', 'Già da 100 anni esiste un''associazione di apicoltori nel villaggio di marmo Lasa. Questo anniversario sarà celebrato a luglio!ore 10 Santa messa nella chiesa parrocchiale (in lingua tedesca), con benedizione della bandiera dell''associazionePoi sfilata con la banda "Laaser Böhmische" fino alla piazza di festa all''Ausserloretzhof.Festa con cibo e bevande eintrattenimento musicale con il gruppo "Laaser Böhmische" e dalle ore 15 con il gruppo "Die Tengler".'),
('8F118C2CCB854FF7A9B77C3AC19BCAFC', 'deu', 'Die Kohlerer Seilbahn feiert 100 Jahre am 29. Juni 2018!Ab 16 Uhr bei der Bergstation wird ein Stück Südtiroler Verkehrs- und Tourismusgeschichte mit einem Fest, Getränken und einem kleinen Imbiss gefeiert.Ab 14 bis 22 Uhr ist die Fahrt mit der Bahn kostenlos!'),
('8F118C2CCB854FF7A9B77C3AC19BCAFC', 'eng', 'The Colle-Kohlern cablecar celebrates its 100th anniversary on June 29th 2018!Starting at 4 pm, at the top station of the cable car, we will celebrate a piece of history of transport and tourism in South Tyrol. The celebration will be accompanied by refreshments.Free uso of the cable car from 2pm to 10pm.'),
('8F118C2CCB854FF7A9B77C3AC19BCAFC', 'ita', 'La funivia del Colle festeggia i suoi 100 anni il 29 giugno 2018!A partire dalle ore 16, presso la stazione a monte della funivia, si festeggia un pezzo di storia dei trasporti e del turismo in Alto Adige. I festeggiamenti saranno accompagnati da un rinfresco.Dalle ore 14 alle ore 22 la funivia sará ad uso gratuito per tutti!'),
('377ADD10E0F14C78988B9A86DAD1462F', 'deu', '1919 – 2019: Südtirol  in den letzten 100 Jahren oder der Geburtstag einer Greisin (ein Stück für ein Volk)Aus der naiven und bodenständigen Erzählperspektive eines Knechts, wird die Geschichte eines Gasthofs in einem südtiroler Bergdorf, vom Anschluss des Landes in Italien 1919 bis zur Gegenwart, als Familiensaga erzählt. Während die historischen Ereignisse als Rahmenhandlung dienen, geht es in dem Stück um den Drang nach Freiheit und seiner Diskrepanz zu einer tiefen Verwurzelung mit der Heimat, um Erbe und um die Liebe zweier Männer zu einer Frau. Vor dem Hintergrund historischer Ereignisse mischen sich absurde Komik und tragische Realität zu einem bitterbösen und gleichzeitig einfühlsamen Portrait eines einfachen und ebenso schwierigen Bergvolks.Dietmar Gamper verwebt Elemente aus Kabarett, Geistergeschichte und Volksstück, um ein Kabinettstück zu schaffen, das etwas schier Unmögliches versucht: 100 Jahre Südtirol an einem Abend! Regie und Text: Dietmar GamperEs spielen: Marlies Untersteiner, Josef Lanz, Peter Schorn, Eva Kuen, Freddy RedavidMusik: Simon Gamper'),
('1A2B6A30FB6E46BDB2644B6984D06C29', 'deu', 'Für Naturliebhaber gibt es nichts Schöneres als intensive Blütenfarben und herrliche Düfte. Diese Führung bietet Erlebnisse für alle Sinne: bunte Kräuterfelder, ätherische Öle, die in die Nase steigen, herrliche Aromen beim Verkosten und vollkommene Ruhe.Wir starten mit einem Besuch im Kräutergarten, schauen in die Trocknungs- und Verarbeitungsräume, entdecken eine Vielzahl von Kräuterprodukten und beenden unseren Rundgang mit einer kleinen, aber feinen Produktverkostung aus frischem Tee, fruchtigem Sirup, würzigem Schnapsl.Wer sich für Kräuter interessiert, wird sicherlich viel Wissenswertes über Anbau, Trocknung, Lagerung und Verwendung unserer Heil- und Gewürzpflanzen mit nach Hause nehmen.Treffpunkt & Start: Kräutergärten Wipptal, Steirerhof, Hintere Gasse 152, Wiesen um 09.45 UhrDauer: von 9.45 bis 11.45 UhrZeitraum: mittwochs vom 16. Juni bis 25. August 2021Vom 1. Juli bis zum 26. August 2021: Zusatzführungen donnerstags um 09.45 – 11.45 UhrAnforderungen: Mund-Nasen-SchutzTeilnehmeranzahl: min. 4 und max. 20 PersonenKosten: Für activeCARD Inhaber kostenlos, ansonsten 10,00€ p.P.Achtung: Eine Anmeldung ist erforderlich!'),
('1A2B6A30FB6E46BDB2644B6984D06C29', 'ita', 'Per gli amanti della natura non c’’è niente di più bello che vivere i colori e profumi dei fiori di stagione. Questa visita guidata offre un’’esperienza per tutti i nostri sensi: campi colorati, oli essenziali profumati, aromi gustosi e una pace ineguagliabile.Si parte con una visita presso i giardini aromatici, si prosegue attraverso le stanze dove vengono essiccate e lavorate le erbe scoprendo la vastità dei prodotti che vengono elaborati e si conclude la visita con una piccola degustazione di tè fresco, succoso sciroppo, una grappa speziata.Gli interessati al mondo delle erbe saranno sicuramente pienamente soddisfatti delle informazioni che riceveranno riguardo a tutti i processi di raccolta, essiccazione e utilizzo delle nostre piante.Ritrovo e partenza: Giardini aromatici Wipptal, Steirerhof, Hintere Gasse 152, Prati ore 09.45 Durata: dalle 9.45 alle 11.45 Periodo: ogni mercoledí dal 16 giungo al 25 agosto 2021Dal 1° luglio al 26 agosto 2021: visite guidate anche il giovedì dalle 09.45 alle 11.45Obbligatorio: Protezione bocca e naso (mascherina) Numero di partecipanti: min. 4 - max. 20 personeCosti: per chi possiede l‘activeCARD é gratis, altrimenti 10,00€ a personaAttenzione: la prenotazione è obbligatoria!'),
('FCDEB65BAF22402380F06B977C91A54B', 'deu', 'Am Sonntag, 09. September findet in Saubach um 10:00 Uhr die heilige Messe statt. Anschließend beginnt das traditionelle Zwetschkenfest. Das Essen und die Getränke werden von den Bäuerinnen und Bauernjugend serviert. Für die musikalische Unterhaltung sorgen die Musikkapelle Barbian und die Carreras. Alle sind recht herzlich eingeladen. Auf Euer Kommen freuen sich die Bäuerinnen und die BJ-Barbian.'),
('FCDEB65BAF22402380F06B977C91A54B', 'eng', 'Sunday, 9th September at 10 am with mass at the chruch at Saubach/S. Ingeniuno followedby the traditional festival of plum.Entertainment with the music band of Barbian and the Group "Carreras".The "Bäuerinnen" and the group "Bauernjugend" of Barbian would be happy to have you as their guest.'),
('FCDEB65BAF22402380F06B977C91A54B', 'ita', 'Domenica, 9 settembre alle ore 10 si terrá la santa messa nella chiesa di San Ingenuino e di seguito iniza la tradizionale festa delle prugne. Intrattenimento musicale con la banda musicale di Barbiano e il gruppo "Carreras".I "Bäuerinnen" e il gruppo "Bauernjugend" di Barbiano sono lieti di darVi il benvenuto.'),
('303E1B8404CD473483D9A37D8C521F62', 'deu', 'Das Barcamp Südtirol ist eine Plattform für den Wissensaustausch und die Vernetzung von Akteuren in den Branchen Tourismus und Kommunikations- und Informationstechnologie mit thematischerm Schwerpunkt „Einsatz von digitalen Technologien im Tourismus“. Organisation: NOI AG, in Zusammenarbeit mit IDM Südtirol, dem Hoteliers- und Gastwirteverband (HGV) und der Kurverwaltung Meran. Die Teilnahme am Barcamp ist kostenlos.Anmeldung hier:'),
('303E1B8404CD473483D9A37D8C521F62', 'eng', 'The Barcamp Südtirol is a platform for the exchange of knowledge and the networking of parties in the sectors of tourism and communication and information technology with a thematic focus on "Use of digital technologies in tourism". Organization: NOI AG, in cooperation with IDM Südtirol, the Hoteliers- und Gastwirteverband (HGV) and the Tourist Office Merano. Free entry.The following link for registration:'),
('303E1B8404CD473483D9A37D8C521F62', 'ita', 'Il Barcamp Südtirol è una piattaforma per lo scambio di conoscenze e una rete di operatori nei settori Turismo e Tecnologie dell’’Informazione e Comunicazione. Il tema principale dell’’evento è l’’utilizzo di tecnologie digitali nel settore turistico. Organizzazione: NOI Spa, in collaborazione con IDM Südtirol-Alto Adige, l’’Unione Albergatori e Pubblici Esercenti dell’’Alto Adige (HGV) e l’’Azienda di cura, soggiorno e turismo Merano. La partecipazione al barcamp è gratuita.Link per registrarsi:'),
('9FA3C0F97FD84F12957E6F73FCBB0389', 'deu', '10. Dolomiten WandertagInfo: lia.ciambonfs@rolmail.net'),
