('A8F3E3A8522143448672AD80435A38BE', 'deu', 'Im Rahmen des Oldtimer-Klassikers führt eine Etappe auf das Rittern Sonnenpaletau.Ankunft der ersten Oldtimer beim Eisring der Arena Ritten in Klobenstein um 10.15 Uhr, anschließend Präzisionsbewerb im Zentrum von Klobenstein. Die Autos können im Zentrum von Klobenstein und am Parkplatz Zentral begutachtet werden.'),
('A8F3E3A8522143448672AD80435A38BE', 'eng', 'A stage of the classic old-timer race stops at Ritten/Renon.Arriving of the cars at Klobenstein/Collalbo at 10.15The old-timers can be seen at Zentral parking'),
('A8F3E3A8522143448672AD80435A38BE', 'ita', 'Una tappa del classico delle auto d''epoca porta sull''altipiano del Renon.Arrivo delle auto d’’epoca all’’anello di ghiaccio dell’’Arena Ritten a Collalbo alle ore 10.15 e successiva prova cronometrata di precisione nel centro di Collalbo. Le macchine vengono parcheggiate al parcheggio Zentral a Collalbo.'),
('0465D969FB9642DB98F49ABE952CA66F', 'deu', 'Man lernt nirgends so viel in so kurzer Zeit wie bei so einem Gitarrenworkshop.Alle Teilnehmer kriegen sozusagen Stoff für ein halbes Jahr und vieles an theoretischem Wissen – Wissen, das sie umsetzen können, nicht bloße Theorie. Es ist alles möglich: Liedbegleitung, Musikstile (Blues, Bossa usw.), Improvisation.   Nach dem Motto: Ihr sagt, WAS ihr spielen & lernen wollt   und Ossy sagt, WIE man es spielt. Workshop 1: für Anfänger und leicht FortgeschritteneWorkshop 2: für Fortgeschrittene'),
('20D8424667EF42ACAD390F6F6BD9AF42', 'deu', '10. Golderner Fosnocht im Schießstand von Goldrain, bei der Faschingsrevue des Männerchors Goldrain sind ihre Lachmuskeln gefragt.'),
('499783AA7CF34A0F86EC63FB706459CD', 'deu', 'Heuer ist es wieder soweit! Elf Vereine heißen Euch zum 10. Grieser Platzfest willkommen und freuen sich auf Euer Kommen!Programmübersicht:Samstag 26.0517.00Uhr: Eröffnung des Festes mit Fassanschlag unter der musikalischen Begleitung der Böhmischen der Bürgerkapelle Gries.18.00Uhr: Eröffnung der Benefizaktion zu Gunsten des Bäuerlichen Notstandsfonds am Stand der Südtiroler Gärtner.Ab 19.30Uhr spielen die Bands Plug & Play und No LipstickSonntag 27.058.00-9.30Uhr: Gottesdienst in der Grieser Stiftspfarrkirche11.00Uhr: Frühschoppen mit den Penny Line und den Salten OberkrainerAb 17.30Uhr spielen die Bands Vollbluet und X-LargeFür Kinder Spielmöglichkeiten beim Stand der Jugend Gries, großer Glückstopf beim Männergesangsverein Gries.'),
('499783AA7CF34A0F86EC63FB706459CD', 'eng', 'Two days of festival with lots of traditional music, food and entertainment for everyone!'),
('499783AA7CF34A0F86EC63FB706459CD', 'ita', 'Undici associazioni danno il benvenuto alla decima edizione della festa in piazza Gries!Programma:Sabato 26 maggioore 17.00: inaugurazione della festa con la Böhmische der Bürgerkapelle Griesore 18.00: presso lo stand dei floricoltori di Bolzano si inaugurerá la manifestazione di beneficenza a favore dell`associazione "Bäuerlicher Notstandfonds"A partire alle ore 19.30 suonano i complessi musicali Plug & Play e No LipstickDomenica 27 maggioAlle ore 11.00 Frühschoppen con i Penny Line e i Salten OberkrainerDalle ore 17.30 suonano i complessi musicali Vollbluet e X-LargeAnimazione per i bambini presso lo stand della Jugend Gries, lotteria presso lo stand del Coro di Gries.'),
('39B9AFB528A0483E98BFDACE69AE43CD', 'deu', 'Abfahrt für Gleiter mit Start um 10.30 Uhr am Oberen Horn. Streckenlänge 2,2 km.Anmeldung: www.wintersportbarbian.wordpress.comAnmeldeschluss: 13.02.2019 um 20 Uhr, Nachmeldungen + 5 €Startnummern-Ausgabe am Start ab 9.00 Uhr am Oberen HornMannschaftswertung (3 Teilnehmer)Infos: +39 349 12 62 997 Preisverteilung: ca. 13:30 Uhr'),
