('40ADDFB1A5104A5A89EB123BF7A34CF5', 'deu', 'Jubiläumsfeier <p>Begrüßung und Festrede zum 10-jährigem Bestehen der neuen kombiniertenBibliothek Feldthurns durch BM Konrad Messner und Kulturreferentin Elisabeth Blasbichler Pedratscher.Ich möchte'' ein Clown sein - Texte und Lieder von Hanns Dieter Hüsch.Ein literarisch-musikalisch-poetischer Abend mit Texten und Liedern des großen deutschen Kabarettisten Hanns Dieter Hüsch ( 1925-2005).Interpreten:Alfred E.Mair (Sprache und Gesang) und Robert Neumair ( E-Piano, Trompete, Akkordeon, Perkussion).Ort: Castaneum Feldthurns mit Beginn um 20.00 Uhr.'),
