('9EE43BFB7DE841018148FEB5ED31B537', 'deu', '10 Jahre Römermuseum Mansio Sebatumfreier Zutritt von 10:00 bis 18:00 Uhrkostenlose Führungen um 10:30, 15:00 und 17:00 UhrVeranstaltungen für Kinder im Grundschulalter um 11:00 und 16:00 Uhr'),
