('D5ED433CF94F40B9ACC797592C90BC98', 'deu', 'Festakt am Ing.-Josef-Riehl-Platz am Bahnhof in Oberbozen um 10 UhrProgramm:Festansprachen zum Jubiläum 10 Jahre Rittner SeilbahnMusikalische Umrahmung durch die „Rittner Bauern-Senioren-Musig“Musikalische Einlage & Malwettbewerb der Grundschule OberbozenDie neue Rittner Seilbahn wurde am 23. Mai 2009 eröffnet und bietet mit ihrem flexiblen Fahrplan, der schnellen Fahrtzeit und leichten Erreichbarkeit unzählige Vorteile für Urlauber und Einheimische am Ritten. In nur zwölf Minuten schweben die Gondeln von Oberbozen in die Landeshauptstadt Bozen und das Dank des Vier-Minutentakts ohne Wartezeiten!2018 wurden an den 337 Betriebstagen 1.113.221 Fahrgäste registriert. Im Monat August schwebten 150.245 Fahrgäste mit den Gondeln und im Juli waren es 141.440 Personen. Wir sind gespannt ob wir den Rekord von 10 Millionen Fahrgästen in 10 Jahren erreichen'),
('D5ED433CF94F40B9ACC797592C90BC98', 'eng', 'Festival on the train station in Soprabolzano/Oberbozen at 10 a.m.Just like magic - Suspended in the air as you move up to Renon’’s sunny plateauRenon''s new cable car opened on May 23, 2009, offering a whole bunch of fantastic advantages for vacationers and local commuters alike : a generous schedule, short travel time and easy access. It’’s a true gem. It only takes 12 minutes for the gondolas to move from Oberbozen/Soprabolzano to Bozen/Bolzano –they depart every 4 minutes, so there’’s practically no waiting time.'),
('D5ED433CF94F40B9ACC797592C90BC98', 'ita', 'con saluti da parte degli ospiti d''onore ed intrattenimento musicale alle ore 10 - piazza Ing. Josef-Riehl, stazione a Soprabolzano. La Funivia del Renon è stata inaugurata il 23 maggio 2009. Grazie all’’orario flessibile, la breve durata di viaggio e la facile raggiungibilità, la funivia offre innumerevoli vantaggi per i turisti e la gente del posto. In soli dodici minuti le cabine viaggiano sospese da Soprabolzano fino al capoluogo provinciale di Bolzano e, con viaggi a intervalli di soli quattro minuti, senza tempi d’’attesa! La stazione della funivia a valle è nel centro di Bolzano.'),
('82DAD121ED1F44E0884A688B87104885', 'deu', 'Die Staller Alm - Ausserwegerhütte feiert ihr 10 jähriges Jubiläum und das muss natürlich gefeiert werden.Ab 9 Uhr: Frühshoppen mit Julian und seiner ZieharmonikaAb 13 Uhr: spielt Jonas Oberstaller aus TaistenAuch für die kleinen Gäste ist bestens gesorgt, für sie steht eine Hüpfburg bereit.*Bei schlechter Witterung entfällt die Veranstaltung!'),
('82DAD121ED1F44E0884A688B87104885', 'eng', 'The Staller Alm - Ausserwegerhütte Hut celebrates its 10th anniversary and this must be celebrated.From 9 a.m.: pre-lunch drink with Julian and his accordionFrom 1 p.m.: plays Jonas Oberstaller from TaistenFor the young guests is organized a bouncy castle.*In case of bad weather, the event doesn''t take place!'),
('82DAD121ED1F44E0884A688B87104885', 'ita', 'La Malga Staller - Ausserwegerhütte compie gli anni. Certamente questo è un motivo per festeggiare.Dalle ore 9: Tradizionale "Frühshoppen" con Julian e la sua armonica a manticeDalle ore 13: suonerà Joans Oberstaller di TesidoPer gli ospiti più piccoli aspetterà un castello gonfiabile.*In caso di pioggia l''evento non avrà luogo!'),
