('36AA39BAF87C4DBE9CF973238A974220', 'deu', 'Die Texelbahn lädt anlässlich des 10-jährigen Jubiläum zur Jahrfeier in Partschins.Frühschoppen mit der Partschinser Böhmischen ab 11 Uhr an der Talstation Texelbahn. Ab 12 Uhr spielt die Musikgruppe "Die Klausner" am Gasthof Giggelberg und ab 13 Uhr "Maria Sulzer und Helmuth Gruber" an der Schutzhütte Nasereit!Ab 16 Uhr Radio Tirol Moderator Michl Gamper mit "Freddy Pfister Band", "Marco", "Julia Buchner", "Alexander M. Helmer" und "Allessa" an der Talstation Texelbahn.Gratis Bahnfahrt!'),
('36AA39BAF87C4DBE9CF973238A974220', 'ita', 'Vi invita alla festa del 10° anniversario della funivia "Texel" a Parcines.'),
('A5572B2CF74941C789F3F4E139FB9C0E', 'deu', 'Am 25. Mai 2019 feiert die Traminer Live-Band “Volle Tschodo” ihr 10-jähriges Bestehen mit einem großen Jubiläumsfest in der Schlossakademie Rechtenthal.Die Band wurde 2009 gegründet und überzeugt mit Liedern aus Pop, Rock, Blues, Jazz und Schlager.'),
('A5572B2CF74941C789F3F4E139FB9C0E', 'eng', 'The music band from Tramin, called "Volle Tschodo", is celebrating the 10° anniversary with a big Festival in the garden of Schloss Rechtenthal Castle.'),
('A5572B2CF74941C789F3F4E139FB9C0E', 'ita', 'Il 25 maggio 2019 il gruppo musicale "Volle Tschodo" di Termeno festeggia il suo 10°anniversario con una grande festa nel giardino del Castello Rechtenthal.'),
('4504DB9D28C84D8584856DF340C2037B', 'deu', '"NUDES Das Begehren des Anderen" ist der Titel der 10. Kunstauktion des Südtiroler Künstlerbundes. In der Prisma Galerie werden 45 Unikate zu einmaligen Startpreisen und 4 Black Boxes vorgestellt. Zum Jubiläum dauert die Auktion nicht einen Tag sondern 10 Werktage, an denen in der Galerie Prisma geboten werden kann. Pro Los werden nur 5 Gebote entgegen genommen.Für das Jubiläumsjahr haben wir mit Walter Sonnberger ein neues Konzept erarbeitet: In diesem Jahr gibt es zum ersten Mal in der Geschichte der SKB Auktion ein spezifisches Thema. NUDES. Dabei steht zwar der Akt, der nackte Körper im Mittelpunkt wird allerdings im Sinne von Entblößung und Verborgenem weitgreifend gefasst.Die Auktion startet mit der Vorbesichtigung in der Galerie Prisma am 25. November und dauert bis zum 06. Dezember 2019. Am 06. Dezember ab 19 Uhr werden die Verkäufe bekannt gegeben und die 4 Black Boxes vom Auktionator Walter Sonnberger versteigert.Öffnungszeiten: Mo 14-18 Uhr, Di-Fr 10-13 und 14-18 Uhr und Do 18-20 Uhr, Sa 10-13 Uhr'),
('4504DB9D28C84D8584856DF340C2037B', 'eng', '"NUDES The desire for the beyond" is the title of the 10th art auction of the Südtiroler Künstlerbund. In the Prisma gallery, 45 unique works will be presented at exceptional starting prices and 4 Black Boxes.On the occasion of the jubilee, the auction does not last just one day, but 10 working days during which bids can be made. There is a maximum of 5 bidders per lot.The auction starts with the preview in Galleria Prisma on the 25th November and lasts until the 6th December 2019. On the 6th December the sales will be published and the 4 Black Boxes will be auctioned by Walter Sonnberger.Opening hours: Mon. 2 pm - 6 pm, Tue-Fri. 10 am - 1 pm and 2 pm - 6 pm  and Fri. 6 pm - 8 pm, Sat. 10 am - 1 pmFor the anniversary year, we have developed a new concept with Walter Sonnberger: for the first time in the history of the SKB auction, there will be a specific theme: NUDES. The nude, the body in the centre, will be perceived as a far-reaching unveiling and concealment. This idea is expressed through the silent auction, to which you can aim anonymously, without exposing yourself personally. The Black Box system makes this procedure even more mysterious.'),
('4504DB9D28C84D8584856DF340C2037B', 'ita', '"NUDES Il desiderio dell''oltre" é il titolo della 10a asta d’’arte del Südtiroler Künstlerbund. Nella galleria Prisma saranno presentate 45 opere uniche a prezzi di partenza eccezionali e 4 Black Box. In occasione del giubileo l’’asta non dura un giorno solo bensì 10 giorni lavorativi durante i quali si possono fare le offerte. Per ogni lotto è previsto un massimo di 5 offerenti.Per l’’anno dell’’anniversario, abbiamo elaborato un nuovo concetto con Walter Sonnberger: per la prima volta nella storia dell’’asta del SKB, ci sarà un tema specifico: NUDES. Il nudo, il corpo è al centro, verrà percepito come uno svelare e un celare di ampia portata. Questa idea si esprime attraverso l’’asta silenziosa, alla quale si può puntare in modo anonimo, senza esporsi personalmente. Il sistema delle Black Box rende questa procedura ancora più misteriosa.L’’asta parte con l’’anteprima in Galleria Prisma il 25 novembre e dura fino al 06 dicembre 2019. Il 06 dicembre verranno pubblicate le vendite e saranno messe all’’asta dal battitore Walter Sonnberger le 4 Black Box.Orari d''pertura: lun. 14:00-18:00, mar.-ven. ore 10:00-13:00 e 14:00-18:00 e giov. ore 18:00-20:00, sab. ore 10:00-13:00'),
('37A37707FBEB4F258B32E94885503D14', 'deu', 'Am Samstag und Sonntag jeweils ab 10.00 Uhr bieten die Bauernund Aussteller auf ihren Ständen die typischen Niederdorfer Produkte,wie die Niederdorfer Kartoffeln, Rote Rüben, Kraut, Herbstgemüse, Obst,Eingelegtes, Apfelsaft, Eier, Honig, Natursäfte, Käse und Milchprodukte,Speck und Wurstwaren, Brot und Backwaren, Kräuter, Kräuterprodukteund Blumen sowie Gemüse und Brot zum Verkauf an.Köstlichkeiten aus erster Hand, frisch und schmackhaft.'),
('37A37707FBEB4F258B32E94885503D14', 'ita', 'Sabato e domenica, rispettivamente dalle ore 10.00 i contadinidi Villabassa e diversi espositori della vallata, saranno presenti ai lorostand con prodotti locali, come ad esempio diverse varietà di patate comela Majestic, la Désirée e la Ukama, le rape rosse, i crauti, verdure autunnali,frutta, conserve, succo di mela, le uova, il miele, i succhi naturali, ilformaggio e altri prodotti da latte da fieno, verdure e pane, i dolci, le erbemedicinali e aromatiche, fiori, i sali, i vari salumi enaturalmente anche lo „Speck“.'),
('D368218BBEC44A4899D591EB8C1F4B2E', 'deu', 'Samstag/SonntagKartoffelfest am Von Kurz Platz mit Bauernmarkt jeweils ab 10.00 UhrTypische Gerichte rund um die Kartoffel.Musikalische UnterhaltungReichhaltiges KinderprogrammNutzen Sie die bequeme Erreichbarkeit von Niederdorf mit den öffentlichen Verkehrsmitteln.Fahrpläne unter www.sii.bz.it'),
('D368218BBEC44A4899D591EB8C1F4B2E', 'ita', 'Sabato e domenica "Sagra della Patata" in Piazza von Kurz con Mercatino dei Contadini a partire dalle ore 10.00Piatti tipici intorno alla patataIntrattenimento musicaleVario programma per bambiniUtilizzi i mezzi pubblici e raggiungi comodamente Villabassa.Orari al sito www.sii.bz.it'),
