('AAB92129C6844065BB7B4A82A2F4F2DA', 'deu', 'Riesentorlauf mit Start um 09:45 Uhr am Rittner HornVerlosung mit tollen Preisen!Anmeldung: www.ascbarbian.com; egger.hubert@dnet.it;Anmeldeschluss: 03.01.2018 um 21.00 UhrMannschaftswertung 3 Personen.Der Veranstalter übernimmt keine Haftung vor, während und nach dem Rennen!Ein Teil des Erlöses wird für einen guten Zweck gespendet!'),
('60C1E3AC92E1429988D4DEED4BEB7393', 'deu', '10. Südtiroler Sängerskirennen in Prags!Einschreibung: innerhalb Freitag, 11.März 2016 - 18.00 UhrNachmeldung: am Renntag, von 10.00 - 12.00 Uhr in der Skihütte Bar-Restaurant SonnleitenNummernverteilung: ab 12.15 Uhr - ZielgeländeStart: Samstag, 12. März 2016 - um 13.00 UhrTageskarte: Gültige Skipässe: Hochpustertal, Kronplatz und Dolomiti Superski                  Für Teilnehmer ohne gültige Skipässe: ermäßigte HalbtageskarteNenngeld: 10,00 €                 Kinder bis 14 Jahren: 8,00€                Gästeklasse: 13,00 €Siegerehrung: Im Anschluss an das Rennen im ZielgeländeAnschließende Partystimmung mit Livemusik!'),
