('25CE3C696D104E09A29A8CD00AB30B4D', 'deu', 'Programm:Eigene alpenländische MusikBei Regen findet das Konzert im Mehrzwecksaal von Pfatten statt.Eintritt freiWenn Di Vògaiga aufspielen, also vorgeigen, dann klingt das nicht nur vertraut und normal. Zuweil wecken die kreativen Musiker sogar den Eindruck, als würden sie ihren Aufritt "vergeigen", was jedoch durchaus beabsichtigt ist, denn sie wollen überraschen und staunen machen. In jedem Fall ist ihre Musik alpenländisch, humorvoll und modern. 2011 ist das Gründungsjahr dieses Ensembles.'),
('25CE3C696D104E09A29A8CD00AB30B4D', 'ita', 'Programma:Proprie musiche alpineIn caso di maltempo il concerto si terrà nella sala polifunzionale di Vadena.Ingresso gratuitoQuando Di Vògaiga suonano, nell''aria si sente qualcosa di familiare e comune. Spesso questi musicisti creativi danno l''impressione di sbagliare mentre si esibiscono, questo è del tutto voluto, dato che vogliono sorprendere e stupire il loro pubblico. Comunque la loro musica è alpina, piena di umore e moderna. Di Vògaiga si sono formati come ensemble nel 2011.'),
('47FD17D2DE264AAEBF6E44B3C32D1367', 'deu', '2019 feiert das Dolomiten UNESCO Welterbe sein zehnjähriges Jubiläum. Das Dolomites UNESCO Fest in St.Vigil/San Vigilio ist die Hauptveranstaltung der Jubiläumsfeierlichkeiten. 10:00 Uhr: Heilige Messe mit Paul Renner und Pfarrer Heinrich Perathoner<br>11:00-17.00 Uhr: Das Herzstück des Festes bilden die Beiträge verschiedener Institutionen und Vereine, die auf der Erlebnismeile mit einem vielseitigen Programm, mit Spielen, kulinarische Köstlichkeiten und geführten Wanderungen für Kinder und Erwachsene für das Welterbe sensibilisieren und informieren. <br>11:30 Uhr: Offizielle Reden<br>14:30 Uhr: Großer Festumzug der Sagen des Fanesreiches<br>Ab 18:00 Uhr: Musikalischer Unterhaltung mit Alexander d’’Al Plan und Ermes Costa und kulinarische Köstlichkeiten.<br>Ab 20:00 Uhr: Konzert der Band Volxrock <br>'),
('47FD17D2DE264AAEBF6E44B3C32D1367', 'eng', 'On 29.06.2019 the official <b> 10th anniversary of Dolomiti UNESCO </b> will take place in St. Vigil in Enneberg. With this great event, St. Vigil can point out the importance and great importance of the UNESCO trademark for our landscape, above all for the local population and, consequently, for all visitors. <P>10:00 am: Holy Mass with Paul Renner and Pastor Heinrich Perathoner <br>10 am - 6pm: <b>Cultural, gastronomy & musical programme for kids and adults:</b> <br>2:30 pm: Big  parade of the legends of the Fanes empire <br>6 pm: Music intertaiment with Alexander d’’Al Plan & Ermes Costa and culinary dishes<br>8 pm: Concert with the band Volkrock <br>'),
('47FD17D2DE264AAEBF6E44B3C32D1367', 'ita', 'Il 29.06.2019 si svolgerà il <b> 10 ° anniversario ufficiale delle Dolomiti UNESCO </b> a San Vigilio. Con questo grande evento, San Vigilio può sottolineare l''importanza e la grande importanza del marchio UNESCO per il nostro paesaggio, soprattutto per la popolazione locale e, di conseguenza, per tutti gli ospiti. <p>Ore 10:00:  Santa Messa con Paul Renner e Heinrich Perathoner <br>Ore 11:00-17:00: Il cuore della manifestazione è il miglio esplorativo; qui grandi e piccini potranno visitare ed esplorare i diversi stand informativi, culinari e naturalistici offerti dalle istituzioni ed associazioni, come anche partecipare a delle escursioni guidate. <br>Ore 11:30: discorsi ufficiali <br>Ore 14:30: Grande sfilata delle leggende del Fanes <br>Ore 18:00: Intrattenimento con Alexander d’’Al Plan e Ermes Costa e gustosità culinarie.<br>Ore 20:00: Concerto con il gruppo Volkrock <br>'),
('BFF16EC65D344F66BC1AB47D20347D74', 'deu', 'International angesehene Lehrmeister der verschiedensten Disziplinen leiteten in den vergangenen Ausgaben Seminare und vielfältige Zusammenkünfte.„Merano in Yoga“ ist ein Festival für Einsteiger und Fortgeschrittene gleichermaßen. Mehr Infos:'),
('BFF16EC65D344F66BC1AB47D20347D74', 'eng', 'Important international teachers of different arts kept in the past editions seminars and meetings. It’’s a festival for everyone, beginners, lovers and those already introduced to oriental doctrines and techniques to find some well-being.More informations:'),
('BFF16EC65D344F66BC1AB47D20347D74', 'ita', 'Importanti maestri internazionali di diverse discipline hanno condotto nelle edizioni passate seminari e incontri. Un festival per tutti, principianti, appassionati e praticanti delle discipline orientali e di tecniche per la ricerca del benessere.Ulteriori informazioni:'),
('75199C9977B846F2BAAF84727FFC8242', 'deu', '11. Almsingen auf der Welschellener Alm<p>Transportdienst mit Bus ab Sportplatz von Welschellen!'),
('75199C9977B846F2BAAF84727FFC8242', 'ita', '11. Rassegna Cori alla malga di Rina!<p>Servizio di trasporto con bus navetta dal campo sportivo di Rina.'),
('BD65BB8CC6744C309B77C2EE3A02440E', 'deu', 'WURDE WEGEN SCHLECHTER WITTERUNG ABGESAGT.Am Sonntag, 08. September 2019 findet in Saubach mit Beginn um 11:00 Uhr das 11. Barbianer Zwetschkenfest in Saubach statt. Um 12:00 Uhr Anschneiden des Barbianer Zwetschkenstrudels. Für das leibliche Wohl sorgen die Barbianer Bäuerinnen und die Bauernjugend mit traditionellen Zwetschkengerichten. Es unterhalten Sie die "Böhmische Kollmann" und "Die Carreras aus Süddtirol".Wir freuen uns auf Euer Kommen!'),
('BD65BB8CC6744C309B77C2EE3A02440E', 'eng', 'WAS CANCELLEND BECAUSE OF THE BAD WEATHER FORCASTOn Sunday, 08. September 2019, in Saubach is beginning at 11 o Clock the 11th Festival of plum from Barbian in SaubachAt 12:00 clock cutting Barbian plum strudel.For the physical well-being of the Barbian farmers and the peasant youth provide with traditional plum dishes. You entertain the "Böhmische Kollmann" and the "Carreras from South Tyrol".We look forward to seeing you!'),
('BD65BB8CC6744C309B77C2EE3A02440E', 'ita', 'È STATO ANULLATO A CAUSA DEL MALTEMPODomenica, 8 settembre alle ore 11 inizio della tradizionale festa delle prugne a San Ingneuino/Barbiano. Intrattenimento musicale con il gruppo"Kollmanner Böhmische" e i "Carreras aus Südtirol". Tutti sono invitati!'),
('26055F0E32CE4D5BACF1AE4092385C23', 'deu', 'Während der 11. Barbianer Zwetschkenwochen verwöhnen Sie die Barbianer Gastbetriebe mit Gerichten rund um die Barbianer Zwetschke. In den Barbianer Geschäften erhalten Sie verschiedene Produkte aus der köstlichen, blauen Frucht: Zwetschkenbrot, Süßspeisen und vieles mehr.Die teilnehmenden Betriebe:Bäckerei Rabanser, Buschenschrank Unteraichnerhof, Gasthof Briol, Gasthof Rösselwirt, Gasthof Saubacherhof, Gasthof Zur Traube, Gemischtwarenhandel Rabanser "Despar".'),
('26055F0E32CE4D5BACF1AE4092385C23', 'eng', 'During the  Plum Weeks in Barbian, the  hotels and restaurants will be offering exquisite specialties made of  plums, while in the shops in Barbian you can get a variety of products from the delicious blue fruit: plump bread, sweets and much more.Restaurants and Shops:Bakery Rabanser, Farmers Inn Unteraichnerhof, Rastaurant Briol, Restaurant Rösselwirt, Restaurant Saubacherhof, Restaurant Zur Traube, Market Rabanser "Despar".'),
('26055F0E32CE4D5BACF1AE4092385C23', 'ita', 'Durante le settimane delle prugne di Barbiano i ristoranti servono piatti squisiti a base di prugne autoctone, nei negozi si trovano prodotti tipici di questo delizioso “frutto blu”: pane alle prugne, dolci e tanti altri prodotti.Ristoranti e negozi partecipanti:Panificio Rabanser, Locanda contadina Unteraichnerhof, Albergo Briol, Albergo Rösselwirt, Albergo Saubacherhof, Albergo Zur Traube, Alimentari Rabanser "Despar".'),
('98ACF86788904DD19E36408BDA8565CE', 'deu', 'Nostalgie pur bei der Oldtimer Rallye "Eggental Herbst-Classic": Edle Fahrzeuge mit grollenden Motoren und altem Leder bringen vom 06. Oktober bis 09. Oktober 2016 das Eggental wieder zum Beben. Zahlreiche Oldtimerbegeisterte aus verschiedenen Ländern treffen sich nun bereits zum 11. Mal im Eggental, um gemeinsam die Oldtimersaison mit einer der schönsten Rallyes ausklingen zu lassen. Die Vielfältigkeit der Landschaft südlich der Alpen ermöglicht es uns auch heuer wieder Routen zu fahren und Plätze zu entdecken, die wir alle so noch nicht kennen und uns sicherlich wieder unbeschreiblich schöne Momente schenken werden. Der neue Rennmodus von Karlheinz Schott die Bewährungsprobe mit Bravour bestanden und so wird auch die diesjährige Rallye nach demselben Prinzip ablaufen.Eine traumhafte Landschaftskulisse in Zusammenhang mit erstklassigen Gaumenfreuden, lustigen Abenden und netten Leuten versprechen schon jetzt eine unvergessliche Eggentaler Herbst Classic 2016.'),
('98ACF86788904DD19E36408BDA8565CE', 'eng', 'For the 11th year verhicles with grumbling motors and antique leather transform the Val d''Ega, from 6th to the 9th October 2016, into a paradise for classic car passionates.Participants from different countries meet already got the 11th time in Val d''Ega to finish off the classic car season with one of the most beautiful rallies.'),
('98ACF86788904DD19E36408BDA8565CE', 'ita', 'Un evento da segnare in agenda per proprietari e appassionati di auto d''epoca: un raffinato tour di 3 giorni e 400 km tra cime e vallate dolomitiche, che unisce lo spettacolo dell''autunno e l''atmosfera prestigiosa garantita dalle 4 ruoto di un tempo.Macchine d’’epoca con motori rumorosi e cuoio vecchio trasformeranno la Val d’’Ega dal 06 ottobre al 09 ottobre 2016 in un paradiso per gli appassionati di queste macchine storiche. Partecipanti provenienti da tutto il mondo si danno appuntamento per l’’nona volta in Val d’’Ega per partecipare ad uno dei rally più belli e per celebrare insieme la fine della stagione. La varietà del paesaggio delle Alpi ci dà la possibilità di scegliere anche quest’’anno percorsi ancora sconosciuti che ci regaleranno sicuramente dei momenti emozionanti e indescrivibili. Un incantevole paesaggio abbinato con squisite delizie del palato, divertenti serate in compagnia e gente simpatica promettono già adesso un’’Eggentaler Herbst Classic 2016 indimenticabile.'),
('0CE668469A1445A58A658607B9D6C92E', 'deu', 'Leichte Gipfel, steile Anstiege, sattgrüne Hochalmflächen und das alles umrahmt von Ein- und Ausblicken in die einmalige Bergwelt der Ostalpen mit Rieserferner, Hohe Tauern und die nahe gelegenen Dolomiten.1 Wanderung - 11 Gipfel - 2800 HöhenmeterDIE ANMELDUNGEN ZUR 11-GIPFEL-TOUR 2022 ÖFFNEN ENDE MAI / ANFANG JUNI (Datum wird noch festgelegt)'),
('0CE668469A1445A58A658607B9D6C92E', 'eng', 'Easy peaks, steep rises, deep green alpine meadows and that all surrounded by a fantastic view to the unique mountain world of the Eastern Alps with Rieserferner Group and Hohe Tauern and the famous Dolomites.1 Tour - 11 peaks - 2.800 m difference in altitudeTHE REGISTRATIONS FOR THE 11 SUMMIT TOUR 2022 OPEN AT THE END OF MAY / BEGINNING OF JUNE (date to be determined)'),
('0CE668469A1445A58A658607B9D6C92E', 'ita', 'Cime facili, salite ripidi, alpeggi e tutto questo circondato da una vista panoramica mozzafiato verso le Vedretti di Ries, gli Alti Tauri e le vicine Dolomiti.1 giornata - 11 cime - 2800 m di dislivelloLE ISCRIZIONI AL TOUR INIZIANO A FINE MAGGIO / INIZIO GIUGNO (data da stabilire)'),
('41A78ED159624AFD803418A89E95E388', 'deu', 'Der längste Riesentorlauf des Pustertals.StreckenprofilStart: 2.030 mZiel: 1.125 mHöhenunterschied: 905 mStreckenlänge: 4,5 kmTore: 104'),
('41A78ED159624AFD803418A89E95E388', 'eng', 'The longest giant slalom race in the Pusteria Valley.CourseStart: 2.030 mArrival: 1.125 mAltitude difference: 905 mCourse length: 4,5 kmGates: 104'),
('41A78ED159624AFD803418A89E95E388', 'ita', 'Lo slalom gigante più lungo della Val Pusteria.Profilo del percorsoPartenza: 2.030 mArrivo: 1.125 mDislivello: 905 mLunghezza percorso: 4,5 kmPorte: 104'),
('4CF166956D8A49938CA84B06C77C878E', 'deu', 'Berglauf in einmaliger Landschaft mit Start im Dorfzentrum von Schenna und Ziel am Piffinger Köpfl in Meran 2000: mit einer Streckenlänge von 10 km (davon 3 km Asphalt, 7 km Bergpfad) und einem Höhenunterschied von 1300 m eine athletische Herausforderung.'),
('4CF166956D8A49938CA84B06C77C878E', 'eng', '10 km (+1300 m altitude difference): 3 km asphalted road, 7 km mountain path'),
('4CF166956D8A49938CA84B06C77C878E', 'ita', 'Una competizione in un splendido paesaggio montano con partenza al centro di Scena e arrivo al Piffinger Köpfl a Merano 2000. Una vera sfida sportiva su un tracciato di 10 km (3 km strada massicciata, 7 km sentiero) con un dislivello di 1300 m.'),
('991A294AF8334FF98B44462F2078D6E6', 'deu', 'Die Marmotty Trophy gehört zu den Klassikern der Ski-Wettkämpfen, auch in diesem Jahr findet das Vertikalrennen und das klassische Skitouren-Einzelrennen im Martelltal statt. Zahlreiche Athleten aus der ganzen Welt werden an dem Sportevent teilnehmen. Für Zuschauer bietet die Marmotta Trophy eine Gelegenheit den Sport besser kennenzulernen, der Start und das Ziel sind beim Hotel Paradiso im Hintermartell.'),
('991A294AF8334FF98B44462F2078D6E6', 'eng', 'The Marmotta Trophy belongs to the classics of the sci race, also this year the vertical running and the classic ski tour singles running take part in the sports event. For spectators arises the Marmotta Trophy an opportunity to get to know better the sport, the start and the aim are at the hotel Paradiso in Val Martello.'),
('991A294AF8334FF98B44462F2078D6E6', 'ita', 'Il trofeo Marmotta appartiene ai classici sci scommesse, quest''anno ha tenuta la vertical race e la gara di singolo tour sci classico in Val Martello. Numerosi atleti provenienti da tutto il mondo saranno presenti all'' evento sportivo. Il trofeo Marmotta offre l'' opportunità di saperne di più su questo sport per spettatori, l'' inizio e la fine sono presso l'' hotel Paradiso nella alta Val Martello.'),
('A9DDAF00E3394ADD8C13B8650C16793E', 'deu', 'Alljährlich im Sommer lädt die Bürgerkapelle Latsch zum traditionellen Lederhosen- & Musikfest auf den Festplatz von Latsch. „Goaslschnöller“ und Schuhplattler stimmen die Besucher auf die Festtage ein, am Sonntagvormittag wird zum Frühschoppen aufgespielt. Für Dirndl- und Lederhosenträger gibt es tolle Preise zu gewinnen.'),
('A9DDAF00E3394ADD8C13B8650C16793E', 'eng', 'Every year during summer, the Laces regional orchestra invites people to its traditional Lederhosen and music festival held at the Laces festival grounds. "Goaslschnöller" and Schuhplattler entice the visitors along on the festival days, and people will be playing for a pre-lunch pint on the Sunday morning. There are fantastic prizes to be won by those wearing Dirndl and Lederhosen.'),
('A9DDAF00E3394ADD8C13B8650C16793E', 'ita', 'Tutti gli anni la banda musicale di Laces invita tutti alla tradizionale Festa della musica e dei pantaloni di cuoio nella piazza della festa di Laces. „Goaslschnöller“, gli schioccatori di frusta, e „Schuhplattler“, i danzatori tirolesi, aprono la festa e la domenica mattina ci si ritrova per una colazione tipica. I migliori costumi tradizionali e pantaloni di cuoio saranno premiati.'),
('D53723B3C6D84CFE8708F534816795DF', 'deu', 'Im Zuge der Rieslingtage stellen einige der bekanntesten und renommiertesten Winzer und Kellermeister ihre Betriebe und Weinkollektionen im Wintergarten vom Berggasthof Unterstell vor – grandiose Ausblicke auf das nächtliche Naturns inklusive! Franz Pfeil hat aus Kränzel nicht nur ein renommiertes Weingut gemacht, sondern durch Gartenanlagen, Ausstellungsmöglichkeiten für Künstler und einem Restaurant ein Gesamtkunstwerk geschaffen. 6 Hektar Rebflächen werden bearbeitet, vor allem die Weißweine weisen einen unverwechselbaren Charakter auf.TREFFPUNKT: 20.55 Uhr bei der Seilbahn Unterstell, Abfahrt mit Seilbahn pünktlich um 21.00 Uhr.'),
('A7B108835D774A32A2C558E4F4B6CF54', 'deu', 'Im Zuge der Rieslingtage stellen einige der bekanntesten und renommiertesten Winzer und Kellermeister ihre Betriebe und Weinkollektionen im Wintergarten vom Berggasthof Unterstell vor – grandiose Ausblicke auf das nächtliche Naturns inklusive! Manincor gehört zu den bekanntesten Namen der Südtiroler Weinwelt. Besitzer und Winzer Michael Graf Goëss-Enzenberg, Präsident der Freien Weinbauern Südtirol, wagte die Umstellung auf den biodynamischen Anbau und die weltweite Nachfrage seiner Weine gibt ihm Recht. Manincors Kellermeister Helmuth Zozin stellt bei dieser Verkostung eine Auswahl der Weine vor.TREFFPUNKT: 20.55 Uhr bei der Seilbahn Unterstell, Abfahrt mit Seilbahn pünktlich um 21.00 Uhr.'),
('D6AB0CD4E2514345B260CF2948939036', 'deu', 'Im Zuge der Rieslingtage stellen einige der bekanntesten und renommiertesten Winzer und Kellermeister ihre Betriebe und Weinkollektionen im Wintergarten vom Berggasthof Unterstell vor – grandiose Ausblicke auf das nächtliche Naturns inklusive! Seit 1992 ist Willi Stürz leitender Kellermeister in der Kellerei Tramin und hat sich seitdem zu einem der renommiertesten Kellermeister Italiens entwickelt. Durch seine hohen Qualitätsansprüche gilt die Kellerei Tramin beim Weißwein mittlerweile als eine der ersten Adressen in Italien.'),
('53F39C768F28421DA420A1A8F1D092B8', 'deu', 'Im Zuge der Rieslingtage stellen einige der bekanntesten und renommiertesten Winzer und Kellermeister ihre Betriebe und Weinkollektionen im Wintergarten vom Berggasthof Unterstell vor – grandiose Ausblicke auf das nächtliche Naturns inklusive! Alois Lageder war einer der Wegbereiter des biodynamischen Weinbaus in Südtirol und gehört heute zu den Winzern mit internationalem Renommee. Auch architektonisch ging Lageder neue Wege und ebnete mit der futuristischen Kellerei-Architektur in Margreid den Weg zum Architektur-Boom in der Weinwelt.TREFFPUNKT: 20.55 Uhr bei der Seilbahn Unterstell, Abfahrt mit Seilbahn pünktlich um 21.00 Uhr.'),
('2BA8BA8260084B6198FF083AB689859D', 'deu', 'Im Zuge der Rieslingtage stellen einige der bekanntesten und renommiertesten Winzer und Kellermeister ihre Betriebe und Weinkollektionen im Wintergarten vom Berggasthof Unterstell vor – grandiose Ausblicke auf das nächtliche Naturns inklusive! Peter Dipoli gilt als „Weinpapst in Südtirol“. Er ist Winzer, Weinhändler und Mitbegründer der „Freien Weinbauern Südtirol“. Seine Leidenschaft gilt Weinen, die Terroir, Habitat und Jahrgang bestmöglichen Ausdruck verleihen.TREFFPUNKT: 20.55 Uhr bei der Seilbahn Unterstell, Abfahrt mit Seilbahn pünktlich um 21.00 Uhr.'),
('C8EEE7ADAA66425E84103524A64A9EAF', 'deu', 'Verleihung der Auszeichnung bester Riesling 2014, der auf nationalem Gebiet angebaut wurde. Von den zehn besten werden die ersten Drei prämiert und der Presse vorgestellt.Im Anschluss besteht die Möglichkeit die Weine aus dem Bewerb zu verkosten. Ab 13.00 Uhr im Dolce Vita Hotel Feldhof****S.'),
('757944A711854B49A8EFB53633C6E313', 'deu', 'Vertikale Riesling Verkostung mit dem Weingut Falkenstein (Naturns, Südtirol)Verkosten Sie verschiedene Rieslingjahrgänge des Weinguts Falkenstein, erschmecken Sie Jahrgangsunterschiede und Besonderheiten und beobachten dabei die Entwicklung des Weinguts. Ab 10.00 Uhr im Zivilschutzzentrum Naturns (Gustav Flora-Straße, Halle Weißes Kreuz).Riesling-Gold-PrämierungVerleihung der Auszeichnung bester Riesling 2014, der auf nationalem Gebiet angebaut wurde. Von den zehn besten werden die ersten Drei prämiert und der Presse vorgestellt.Im Anschluss besteht die Möglichkeit die Weine aus dem Bewerb zu verkosten. Ab 13.00 Uhr im Dolce Vita Hotel Feldhof****S (Rathausstraße 4).'),
('8FA372564C5043A5B19AC2B0F4BE3C87', 'deu', 'Gemütliches Beisammensein, guter Wein, entspannende Musik – das sind die Zutaten für einen schönen Abend. Auch dieses Jahr bietet die beliebte Konzertreihe „Wine & Music“ nicht nur musikalische Highlights, sondern auch die Möglichkeit durch die Rieslingwelt zu reisen. Eine speziell von der Weinakadamikerin Monika Unterthurner zusammengestellte Rieslingkarte verspricht eine Auswahl der weltweit Rieslingweine aus internationalen Anbaugebieten.Programm: 15.10.: Duo Subset Beginn: 20.00 Uhr, Bar i’’Tipftl, Hauptstraße 4622.10.: Lukas Insam Trio, Beginn: 20.00 Uhr, Bar Sanzeno, Bahnhofstraße   29.10.: Mas Que Nada, Beginn: 19.00 Uhr, Lebensmittel & Feinkost Unterthurner, Hauptstraße 2205.11.: Bayou Side, Beginn: 20.00 Uhr, Sportbar Naturns, Bahnhofstraße 6712.11.: Frederik’’s, Beginn: 20.00 Uhr, Hotel Restaurant Kreuzwirt, Hauptstraße 47'),
('AB752E976A364BFFA37ED3AB1F130E1A', 'deu', 'Eine der größten Kellereien in Südtirol vereint Klein-und Kleinstproduzenten von Lana bis nach Kastelbell unter seinem Dach. Seit der Fusion 2001 hat sich die Kellerei Meran dem Ausbau von hochqualitativen Weinen verschrieben. Wettbewerbserfolge und Höchstbewertungen haben den neu eingeschlagenen Weg bisher bestätigt.'),
('DE51CC0C0C954A0ABF2ED37C9CD4E389', 'deu', 'Bereits die Architektur drückt aus, wofür die Kellerei Nals steht: Tradition und Innovation. Die Ernte von 150 Hektar wird in dieser Kellerei verarbeitet. Die große Vielfalt an Böden, Lagen, Rebsorten und Mikroklimen spiegelt sich in den charaktervollen Weinen der Kellerei Nals wieder.'),
('BABFEA5ADDCF41CEB3A3750B170024DF', 'deu', 'Johannes Pfeifer gilt als einer der großen Aufsteiger in der Südtiroler Weinwelt und heimst vor allem mit den typisch südtiroler Sorten Lagrein und St. Magdalener Anerkennung und Auszeichnungen ein. Seit über 200 Jahren bewirtschaftet die Familie Pfeifer die Weinberge am Bozner Stadtrand und was über Monate in den Weinbergen reift, wird in den alten Kellern des Gutes zu authentischen Weinen veredelt.'),
('D2EAC305F8C54F1AB77065DA19C2E763', 'deu', 'Der „räthische Wein“ war schon bei den römischen Kaisern besonders beliebt. Nicht auszuschließen, dass der ein oder andere gute Tropfen auf den Böden des heutigen Weinguts Kornell angebaut wurde. Zahlreiche archäologische Funde bezeugen den bereits vorchristlichen Weinanbau in dieser Gegend. Heute wird das Weingut von Florian Brigl geleitet, der aus einer der ältesten Winzerfamilien Südtirols stammt. Aus seinen 15ha Rebfläche schafft er zusammen mit seinem jungen Team einige der spannendsten und besten Weine Südtirols.'),
('2DA979F17AD841D8AA4176851EAB71A1', 'deu', 'Seit über hundert Jahren hat sich die Familie Pfitscher dem Weinbau verschrieben. Vor allem in den letzten Jahrzehnten konnte sich das Weingut durch Fleiß und höchsten Qualitätsanspruch an der vordersten Front der Südtiroler Weinbauern positionieren, hat aber gleichzeitig das Kunststück geschafft, individuell und autark zu bleiben. Die Prognose steht auch weiterhin auf Wachstum und mit Daniel, Hannes und Marion steht schon die nächste Generation des Weinguts Pfitscher in den Startlöchern.'),
('A343F87203F64AF8930FC322232EB781', 'deu', 'Der Beratungsring Berglandwirtschaft lädt auch heuer wieder alle Bergbauern und Interessierte zur alljährlichen Berglandwirtschaftstagung im Forum Brixen ein.Die Tagung beginnt um 09.00 Uhr, der Abschluss ist um 12.30 Uhr vorgesehen. An einem Tag Wissen, Informationen und Erfahrungen sammeln.'),
('A343F87203F64AF8930FC322232EB781', 'eng', 'Der Beratungsring Berglandwirtschaft lädt auch heuer wieder alle Bergbauern und Interessierte zur alljährlichen Berglandwirtschaftstagung im Forum Brixen ein.Die Tagung beginnt um 09.00 Uhr, der Abschluss ist um 12.30 Uhr vorgesehen. An einem Tag Wissen, Informationen und Erfahrungen sammeln.'),
('A343F87203F64AF8930FC322232EB781', 'ita', 'Anche quest''anno il "Beratungsring Berglandwirtschaft" invita tutti i contadini in montagna ed interessati a venire a questo convegno presso il Forum Bressanone. Il convegno inizia alle ore 9 e dura fino alle ore 12.30. Venga anche Lei e si informi sulle tematiche nuove.'),
('256E7CD054EF499D951A4C8AD1365916', 'deu', 'Ja liebe Freunde es ist soweit, der 11. Vinschger Lederhosenball steht vor der Tür, am 27. April 2018 im Kultursaal von Burgeis organisiert von den ORIGINALEN SCHLEISER.Für Stimmung sorgen "Sauguat" ,die "Freddy Pfister Band"und "NEEDEX and LR"Eintritt ab 18 Jahren nur mit Diendl, Lederhosen und/oder traditioneller Tiroler Kleidung.Auf Euer Kommen freut sich die gesamte Mannschaft der Originalen Schleiser und des ASC Schleis'),
('256E7CD054EF499D951A4C8AD1365916', 'ita', 'Ballo dei "Lederhosen" (pantaloni tipici in pelle) nella sala culturale di Burgusio.Ingresso solo con vestiti tirolesi: Lederhosen, Dirndl, ecc.Intrattenimento musicale con il gruppo "Sauguat" , "Freddy Pfister Band"e "NEEDEX and LR"'),
('5771E303F5274496B46EAF8CB884CFF8', 'deu', 'Einfach Green Pass bereit halten - wir freuen uns auf Ihren Besuch!Während der Adventszeit liegt eine vorweihnachtliche Stimmung in der Fußgängerzone von Schlanders. Am Wochenende Mitte Dezember findet der alljährliche Weihnachtsmarkt statt. Vinschger Hobby-Künstler und Handwerker sowie heimische und italienische Produzenten bieten handgemachte Geschenkideen, traditionelles Kunsthandwerk und lokale Produkte.Umrahmt wird das romantische Wochenende im Herzen von Schlanders durch weihnachtliche Klänge.In den Geschäften finden Sie spezielle Aktionen und die Gastbetriebe verwöhnen Sie mit traditionellen und lokalen Köstlichkeiten.Termine:11. + 12.12.202118. + 19.12.2021Wichtig für Ihren Besuch:1. Zeigen Sie Ihren Green Pass an einem unserer Check-Points 2. Sie erhalten ein Armband das den ganzen Tag gültig ist3. Sie können Konsumation und Einkäufe innerhalb des Weihnachtsmarktes frei tätigen.Passanten sowie Anrainer die den Markt nicht besuchen möchten benötigen kein Armband und auch keine Green Pass Kontrolle.'),
('5771E303F5274496B46EAF8CB884CFF8', 'eng', 'During the Advent time there is a pre-Christmas atmosphere in the pedestrian zone of Silandro. On the weekend mid December the annual Christmas market takes place. Venosta hobby artists and craftsmen as well as local and Italian producers offer handmade gift ideas, traditional crafts and local products.The romantic weekend in the heart of Silandro is surrounded by Christmas sounds.In the shops you will find special offers and the restaurants spoil you with traditional and local delicacies.Date:11. + 12.12.202118. + 19.12.2021Important for your visit:1. Show your Green Pass at one of your Check Points2. you will receive a wristband that is valid for the whole day3. you can freely consume and make purchases within the Christmas market.'),
('5771E303F5274496B46EAF8CB884CFF8', 'ita', 'Tenete pronto il vostro Green Pass - vi aspettiamo!L’’area pedonale di Silandro si trova in un’’atmosfera prenatalizia nel tempo d’’avvento. Il Mercatino di Natale tradizionale di Silandro si svolge ogni anno il fine settimana a metà dicembre. Artisti amatoriali e artigiani venostani nonché produttori locali e provenienti da tutta Italia offrono idee regalo fatte a mano, artigianato tradizionale e prodotti tipici.Il week-end romantico nel centro di Silandro viene completato da suoni natalizi.Nei negozi troverete azioni speciali e i ristoranti viziano con prelibatezze tradizionali e locali.Date:11. + 12.12.202118. + 19.12.2021Importante per la vostra visita:1. Fate verificare il vostro Green Pass presso i nostri Check-Points2. Riceverete un braccialetto che è valido per tutta la giornata3. Effettuate consumazioni e acquisti liberamente all''interno del mercatinoPer chi non vuole visitare il mercatino non è obbligatorioI passanti e i residenti che non vogliono visitare il mercatino non hanno bisogno di un braccialetto o di un controlle del Green Pass.'),
('7262A8A541024A95AF68119D7A185492', 'deu', 'Die Freiwillige Feuerwehr organisiert das Gaudirennen (Ski & Snowboard) um den Yeticup!'),
('7262A8A541024A95AF68119D7A185492', 'ita', 'I Vigili del fuoco di Solda organizzano la gara divertimento (sci & snowboard) per il Trofeo Yeti!'),
('E3CA7B9C82CD485EB0A3952DE58CE8EF', 'deu', 'Vorbereitungsbewerb für Feuerwehrjugend und aktive Bewerbsgruppen in SchleisDie Freiwillige Feuerwehr Schleis, Bezirk Obervinschgau feiert im Jahre 2016 ihr 120 jähriges Gründungsjubiläum. Zu diesem Anlass organisiert die FF Schleis am Samstag, den 28. Mai 2016 den Vorbewerb für die westliche Landeshälfte Südtirols. Zu diesem Bewerb sind alle Jugendgruppen sowie aktive Bewerbsgruppen aus dem In- und Ausland recht herzlich eingeladen. Ein besonderes Rahmenprogramm sowie eine tolle Kulisse im Obervinschgau wird diesen Bewerb begleiten. Ein besonderes Highlight wird der Parallelbewerb am Bewerbsabend darstellen. Auf die Sieger des Bewerbs warten tolle feuerwehrtechnische Geräte als Preis. Der Hauptpreis ist eine Wärmebildkamera. Wir hoffen Euch alle recht herzlich zum Bewerb bei uns begrüßen zu dürfen.'),
('519ED83348524507A0705F2D78EECA4D', 'deu', 'Seit 1896 stellt das Haflinger Galopprennen am Ostermontag eine Attraktion für Einheimische und Gäste dar und verbindet bis heute erfolgreich Rennsport und Folklore.Dem Renngeschehen geht dabei stets ein Festumzug der berittenen Teilnehmer in Tracht durch die Meraner Innenstadt voraus, welche von Musikkapellen sowie von Fanfarenbläser begleitet werden. Der große Festumzug beginnt um 10 Uhr am Vinschgauer Tor und bewegt sich durch die Straßen der Innenstadt. Über Rennweg, Freiheitsstraße und Sandplatz, Kurpromenade (Richtung Theaterbrücke), Piave- und Gampenstraße erreicht der Tross den Pferderennplatz Meran.Einlass am Pferderennplatz ab 11 Uhr mit dem Eintreffen des Umzugs. Ab 11.45 Uhr Freispringen, 12.45 Uhr Grußworte der Ehrengäste, 13 Uhr Beginn der Rennläufe (die genauen Startzeiten der einzelnen Rennläufe werden am Tag der Veranstaltung veröffentlicht). Unterhaltungsprogramm für Kinder und Spielplatz. Rahmenprogramm mit verschiedenen Vorführungen, Gastronomieangebot und musikalische Unterhaltung mit DJ. Eintritt: € 13,00 (€ 7,00 für Jugendliche von 16-18 Jahre; Eintritt frei unter 16 Jahre)'),
('519ED83348524507A0705F2D78EECA4D', 'eng', 'On Easter Monday the “Haflinger” horses, famous for their chestnut coats and blond manes, compete at the Merano Racecourse (Via Palade). In the morning there is a procession through town center of many colourful floats accompanied by brass bands in local costumes, while in the afternoon local and international jockeys compete on the track.Departure of the procession from the Vinschger Tor gate at 10 a.m. (route: Via delle Corse, Corso Libertà, Piazza della Rena square, on the Passer Promenade towards Ponte della Posta bridge, Via Piave and Via Palade to the racecourse). The racecourse opens at 11 a.m. The races will start at about 1 p.m. The detailed start times will be communicated at the day of the event. Program for children and playground. Entertainment program with various performances, gastronomic specialties and music. Entrance fees: €13.00 (€7.00 from 16-18 years; free of charge for visitors under the age of 16)'),
('519ED83348524507A0705F2D78EECA4D', 'ita', 'Dal 1896, le corse degli Haflinger del lunedì di Pasqua rappresentano un’’attrazione sia per la popolazione locale e sia per gli ospiti, coniugando sport e folclore.Così come in quel lontano martedì di Pasqua del 1896, ancora oggi le competizioni sono precedute da un corteo con cavalli e cavalieri in costume tipico accompagnati da bande musicali. Il corteo parte alle ore 10 dalla porta Venosta per marciare lungo le strade del centro. Attraverso via delle Corse, corso Libertà e piazza della Rena, Passeggiata Lungo Passirio (direz. ponte Teatro), via Piave e via Palade, la sfilata raggiunge l’’Ippodromo di Merano.Ingresso all’’ippodromo dalle ore 11 con l’’arrivo del corteo. Dalle ore 11.45 salto in libertà, ore 12.45 saluto delle autorità, ore 13 inizio delle corse (gli orari di partenza delle singole competizioni saranno pubblicati il giorno dell’’evento).Programma di divertimento per bambini e parco giochi. Programma di contorno con vari spettacoli, specialità gastronomiche e intrattenimento musicale con DJ. Ingresso: € 13,00 (€ 7,00 dai 16-18 anni; ingresso libero sotto 16 anni)'),
('AED86EEC2DE04B51BCE05EF88655BE06', 'deu', 'Am Ostermontag bildet das Haflinger Galopprennen den Auftakt zur Rennsaison am Meraner Pferderennplatz. Am Vormittag (um 10.00 Uhr) ziehen die prächtig geschmückten Festwagen und Musikkapellen durch die Innenstadt. Programm am Pferderennplatz ab 11.00 Uhr und Rennen ab 13.00 Uhr.'),
('AED86EEC2DE04B51BCE05EF88655BE06', 'eng', 'On Easter Monday, the Haflinger gallop race marks the beginning of the new racing season at the Merano horse racing track. In the morning (at 10 a.m.) the magnificently decorated floats and music bands parade through the city center. Programme of events at the racecourse starts at 11 a.m. and the race starts at 1 p.m.'),
('AED86EEC2DE04B51BCE05EF88655BE06', 'ita', 'Il Lunedì dell''Angelo (Pasquetta), i cavalli Haflinger dal manto sauro e dalla bionda criniera corrono all''Ippodromo di Merano (programma a partire dalle ore 11.00), corse a partire dalle ore 13.00). L''inizio delle corse è preceduto da una sfilata (alle ore 10.00) dei partecipanti con bande e gruppi folcloristici lungo le vie del centro.'),
('F30344CBA89F4FA3A203FEFCBC14DF23', 'deu', 'Dankgottesdienst zum Abschluss des Jubiläumsjahres zelebriert von Dekan Andreas Seehausermusikalische Gestaltung: Stiftschor InnichenPropst Hans Huber führte in den siebziger Jahren des vergangenen Jahrhunderts am 31. Dezember einen Dankgottesdienst ein, der seitdem jedes Jahr vom Stiftschor mit einer Orchestermesse musikalisch umrahmt wird. Es ist dies die passende Gelegenheit, das Jubiläum in der Stiftskirche Innichen feierlich zu beenden.'),
('F30344CBA89F4FA3A203FEFCBC14DF23', 'eng', 'Graduation anniversary year: holy mass with choir and orchestra at the Collegiate Church.'),
('F30344CBA89F4FA3A203FEFCBC14DF23', 'ita', 'Celebrazione della Santa Messa di ringraziamento alla conclusione dell''anno giubilare celebrata dal Decano Andreas Seehauseraccompagnamento musicale: Coro della Collegiata di San CandidoIl parroco Hans Huber ha introdotto negli anni settanta la Santa messa il 31 dicembre; da allora ogni anno il coro della Collegiata si prepara con una messa orchestrale. Questa è l''occasione perfetta per chiudere l''anniversario nella Collegiata di San Candido.'),
('01F2B21DF575485CA794F372D7BC359F', 'deu', 'Organisiert vom Verein „Farbklecks“ anlässlich des Jubiläums „1250 Jahre Innichen“, mit der Aufgabe, die Kreativität der Innichner zu fördern und zu veranschaulichen. Künstlerisch Begabte und Handwerker, welche in Innichen geboren oder hier wohnhaft sind, ebenso Mitglieder des Vereins „Farbklecks“ und der „Freisinger Hobbykünstler E.V.“ nehmen an der Ausstellung teil.Ausstellungsobjekte: gemalte Bilder in jeder Maltechnik, Holzskulpturen und Plastiken in verschiedenen Materialien. Montags: 20.30 – 22.30 Uhr, mit musikalischer Umrahmung'),
('01F2B21DF575485CA794F372D7BC359F', 'eng', '01.07.-28.08.2019:Monday: 8.30 pm - 10.30 pm with music'),
('01F2B21DF575485CA794F372D7BC359F', 'ita', 'In occasione dell''anniversario "1250 anni San Candido", il comitato organizzatore eventi "GIUBILEO 1250 ANNI FONDAZIONE DI SAN CANDIDO" il club artistico FarbKlecks, intende promuovere un laboratorio artistico ed artigianale che illustri la creatività dei cittadini di San Candido.Artisti ed artigiani nativi o residenti a San Candido, i membri del club artistico Farbklecks  ed i membri del „Freisinger Hobbykünstler E.V.“.partecipanno alla mostra.lunedì ore 20.30 - ore 22.30 con intrattimento musicale'),
('71B99F4388844780BF991525B4A582D6', 'deu', 'Organisiert vom Verein „Farbklecks“ anlässlich des Jubiläums „1250 Jahre Innichen“, mit der Aufgabe, die Kreativität der Innichner zu fördern und zu veranschaulichen. Künstlerisch Begabte und Handwerker, welche in Innichen geboren oder hier wohnhaft sind, ebenso Mitglieder des Vereins „Farbklecks“ und der „Freisinger Hobbykünstler E.V.“ nehmen an der Ausstellung teil.Ausstellungsobjekte: gemalte Bilder in jeder Maltechnik, Holzskulpturen und Plastiken in verschiedenen Materialien. Mittwochs: 16.00 – 19.00 Uhr, Vorführung der Handwerker bei der Arbeit Handwerker:03.07.2019: Jud Johann (drechseln)10.07.2019: Knoll Albin & Siegfried Egarter (drechseln & kl. Blumen aus Holz)17.07.2019: Untersteiner Marion (Karten für besondere Anlässe)24.07.2019: Furtschegger Lois (Dekorationen aus Holz)31.07.2019: Siegfried Egarter (kl. Blumen aus Holz)07.08.2019: Rainer Raimund (Arbeiten aus Holz)14.08.2019: Max Weitlaner (kl. Gipsfiguren)21.08.2019: Stanzl Hermann (Krippen bauen)28.08.2019: Max Weitlaner (kl. Gipsfiguren)'),
