('71B99F4388844780BF991525B4A582D6', 'ita', 'In occasione dell''anniversario "1250 anni San Candido", il comitato organizzatore eventi "GIUBILEO 1250 ANNI FONDAZIONE DI SAN CANDIDO" il club artistico FarbKlecks, intende promuovere un laboratorio artistico ed artigianale che illustri la creatività dei cittadini di San Candido.Artisti ed artigiani nativi o residenti a San Candido, i membri del club artistico Farbklecks  ed i membri del „Freisinger Hobbykünstler E.V.“.partecipanno alla mostra.mercoledì ore 16.00 - ore 19.00 saranno presenti gli artigiani al lavoroArtigiani:03/07/2019: Jud Johann (tornitura)10/07/2019: Knoll Albin & Siegfried Egarter (tornitura & piccoli fiori di legno)17/07/2019: Untersteiner Marion (cartoline per occasioni speciali)24/07/2019: Furtschegger Lois (decorazioni di legno)31/07/2019: Siegfried Egarter (piccoli fiori di legno)07/08/2019: Rainer Raimund (lavori con il legno)14/08/2019: Max Weitlaner (piccole figurine di gesso)21/08/2019: Stanzl Hermann (presepi)28/08/2019: Max Weitlaner (piccole figurine di gesso)'),
('E820B0B91C7643799901C375B8B8BED3', 'deu', 'Ausgehend von der Romantrilogie "Eva schläft", "Über Meereshöhe", "Alle, außer mir" diskutiert die italienische Autorin mit ausgewiesenem Südtirol-Bezug zum Thema Identität - Versuch einer Erklärung.Moderation: Elmar Locher & Christine VescoliVeranstaltung in italienischer Sprache'),
