('C7F53144F3EB47D8B0659F321C97DCFC', 'deu', 'Mit Hilfe von 30 im gesamten Dorf verteilten Kennzeichnungsobjekten wird den Interessierten die Geschichte der Marktgemeinde Innichen erzählt.Nachtwächter und Trommler begleiten zu 5 Stationen des Parcours.Idee und Ausarbeitung: Chiara Menguzzowissenschaftliche und künstlerische Beratung: Kuno Prey'),
('C7F53144F3EB47D8B0659F321C97DCFC', 'eng', 'Opening of the historical route with 30 objects in the whole villageThe 30 objects tell the history of San Candido/InnichenNight watchmen and drummers accompany to 5 stations of the historical route.Idea and elaboration: Chiara Menguzzo'),
('C7F53144F3EB47D8B0659F321C97DCFC', 'ita', '30 colonne illustrative distribuite nel paese narrano a tutti gli interessati la storia del Comune di San Candido.Guardiani notturni e batteristi accompagnano a 5 stazioni dell''itinerario storico.Idea e realizzazione: Chiara Menguzzoconsulenza scientifica e artistica: Kuno Prey'),
('06117B224CB743DE99A679398D16C181', 'deu', 'Spaß und Spannung für Jung und Alt bei der Spiel-Olympiade: Luftballonmodellieren, Holzbauhof, Schminkecke...Organisation: Ortsgruppen Innichen, Vierschach und Winnebach des Kath. FamilienverbandesWo? Vor der Grundschule InnichenBei schlechtem Wetter findet die Veranstaltung im Josef-Resch-Haus statt.'),
