('79A07B9380BC44EA908C339C4866EFB2', 'deu', '"Vom Ursprung zur Mehrstimmigkeit"Chöre, Bläser, Streicher und vier Orgeln alternatimGesamtleitung: Martin Steidler, MünchenInstrumental- und Vokalmusik: Norbert Brandauer, SalzburgOrganisatorische Gesamtleitung: Georg Schmid, Obmann des Vereines "cantare et sonare"'),
