('79A07B9380BC44EA908C339C4866EFB2', 'ita', '"Dalle origini alla polifonia"Si alternano cori, strumenti a fiato, strumenti ad arco e quattro organi. Direttore: Martin Steidler, Monaco di BavieraMusica strumentale e vocale: Norbert Braudauer, Salisburgo Organizzatore: Georg Schmid, direttore dell''associazione "cantare et sonare"'),
('45D2D48FF9454AA0AF507B454EAA2606', 'deu', 'Es ist dies der offizielle Höhepunkt des Festes. Mit gesungenen, gespielten, vorgetragenen und inszenierten Ständchen überbringen die Gratulanten aus nah und fern ihre Glückwünsche.Freitag, 31.05.2019 um 18.00 Uhr:Eröffnung MusikpavillonRückblick auf die Baugeschichte-Konzert der Musikkapelle Innichenum 21.00 Uhr:Musik Sommer Pustertal - geistliches Konzert in der StiftskircheSamstag, 01.06.2019 von 14.00 - 24.00 Uhr:Geburtstagsständchen der Nachbargemeinden und der örtlichen Vereine und Verbände.  Samstag, 01.06.2019Eröffnung des "Geschichtsparcours"Sonntag, 02.06.2019 09.00 Uhr:Festgottesdienst in der Stiftskirche zelebriert vom Freisinger Weihbischof Bernhard HaßlbergerMusikalische Gestaltung: Domkantorei Chiave und Bläsergruppe der Stadtkapelle Freising11.00 - 14.00 Uhr:"Freisinger Frühshoppen" mit typischen bayrischen Gerichten und musikalischer Unterhaltung'),
('45D2D48FF9454AA0AF507B454EAA2606', 'eng', 'This is the main event of the anniversary.Friday, 31.05.2019 6 pm:Opening at the bandstand with concert 8 pm:Music Summer Pusteria - concert at the Collegiate ChurchSaturday, 01.06.2019 2 - 12 pm:Birthday party with gastronomic stands. Saturday, 01.06.2019Opening of the historical routeSunday, 02.06.2019 9 am:Church festival service in the Monastery Church11 am - 2 pm:"Morning party of Freising" with tipical dishes and live music'),
('45D2D48FF9454AA0AF507B454EAA2606', 'ita', 'Questo è l''evento più importante dell''anniversario. Venerdì, 31/05/2019 ore 18.00:Apertura padiglione musicale con concerto della banda musicale di San Candidoore 21.00:Musica Estate Pusteria - concerto nella CollegiataSabato, 01/06/2019 ore 14.00 - 24.00:Festa di compleanno con vari stand gastronomici. Sabato, 01/06/2019Inaugurazione del percorso storicoDomenica, 02/06/2019 ore 09.00: Messa solenne celebrata dal vescovo ausiliare di Freising Bernhard Hasslberger. Accompagnamento musicale: Ensemble Chiave e il gruppo di strumenti a fiato della banda musicale di Freisingore 11.00 - 14.00:"Festa mattutina Frisinga" con piatti tipici bavaresi e musica dal vivo'),
('08EE008BB7AB4D248B36A49DF9AAB0F2', 'deu', 'Geburtstagsständchen der Partnerstadt Freising, der Nachbargemeinden, der Kinder aller Schulstufen und der örtlichen Vereine und Verbände14.00 Uhr: Sternmarsch der Musikkapellen Innichen, Vierschach, Winnebach und der Stadtkapelle Freising zum Festplatz beim Musikpavillon14.15-16.00 Uhr: "Geburtstagsständchen" - 1. Teil16.00 Uhr: Festakt "1.250 Jahre Innichen"17.00-20.00 Uhr: "Geburtstagsständchen"- 2 Teil20.00-24.00 Uhr: Musikunterhaltung mit den Ensembles "Pentatoniker" und "Nepomukla"'),
('08EE008BB7AB4D248B36A49DF9AAB0F2', 'eng', 'Birthday serenade by the twin town Freising, the neighboring comunes, the children of the whole school and the local clubs and associations'),
('08EE008BB7AB4D248B36A49DF9AAB0F2', 'ita', 'Tributi della città gemellata Freising, dei comuni limitrofi, dei bambini delle scuole e di associazioni e gruppi locali'),
('A55889C2ACF7440A91EE7E4F3FFC2675', 'deu', 'Titel: "Brannte uns nicht das Herz in der Brust?"Anhand von kurzen Vorträgen, Erfahrungsberichten, Gruppengesprächen, musikalischen Einlagen und gemeinsamen Andachten bzw. Gottesdiensten werden die zentralen Glaubensinhalte von Gründonnerstag, Karfreitag und Osternacht vertieft und für das alltägliche Leben zugänglich gemacht.Samstag, 06.04.:09.00 - 17.00 UhrVorträge und Vertiefung im Franziskanerkloster17.30 UhrGebetszeit (für die Teilnehmer und für alle Interessierten) im Außerkirchl19.30 - 8.00 UhrNachanbetung im FranziskanerklosterSonntag, 07.04.:08.30 - 10.00 UhrVorträge und Vertiefung im Franziskanerkloster10.15 UhrPfarrmesse in der StiftskircheTeilnehmer: öffentlich für alle Interessierten. Für Jugendliche und Kinder wird eigenes Programm angeboten.'),
('A55889C2ACF7440A91EE7E4F3FFC2675', 'eng', 'Religious faith festival for children and parents (in German and Italian language)'),
('A55889C2ACF7440A91EE7E4F3FFC2675', 'ita', 'Titolo: "Arde il nostro cuore?"Tramite brevi presentazioni, racconti di esperienze vissute, discussioni di gruppo, intermezzi musicali, funzioni e celebrazioni di Sante Messe verrano approfonditi i temi centrali del Credo del Giovedì, del Venerdì e del Sabato Santo per avvicinarli e viverli nella vita quotidiana.Sabato, 06.04.:ore 09.00 - 17.00discorsi e approfondimenti nel Convento dei Francescaniore 17.30pregheria (per i partecipanti e tutti gli interessati) nella Chiesa del Santo Sepolcroore 19.30 - 08.00pregheria notturna nel Convento dei FrancescaniDomenica, 07.04.:ore 08.30 - 10.00discorsi e approfondimenti nel Convento dei Francescaniore 10.15celebrazione eucaristica nella CollegiataPartecipanti: aperto per tutti gli interessati. Per i giovanni e i bambini verrà offerto un programma a parte.'),
('80857ABDACF74CFC8D7225C93EE30E7C', 'deu', 'Die großen Feste des kirchlichen Jahreskreises bringen seit der Gründung des Stiftes das "Gehemnis des Glaubens" zum lebendigen Ausdruck. In Text Ritus und Musik bildet die Heilige Woche ein Crescendo, das die Inhalte der Glaubenswoche und des ganzen Jahres umfasst.14.04./10.15 UhrPalmsonntag (mit Palmprozession)18.04./20.00 UhrGründonnerstag, Messe vom letzten Abendmahl19.04./20.00 UhrKarfreitag, die Feier von Leiden und Sterben Christi (Orgeln und Glocken schweigen; Chormusik)20.04./20.30 UhrOsternacht, Hochfest der Auferstehung des Herrn (Öffnen der Orgelflügel beim Gloria, Chor- und Orgelmusik)21.04./09.00 UhrOstersonntag (Chor- und Orchester)Zum Jubiläum der Ortschaft, des Stiftes, und damit auch der Kirchenmusik steht neben Händels "Halleluja" die "Missa Romantica" für Soli, Chor und Orchester auf dem Programm des Stiftchores. Wir freuen uns auf den Besuch des Komponisten der "Missa Romantica", Dr. Ulrich Harbecke zu diesem Anlass.'),
('80857ABDACF74CFC8D7225C93EE30E7C', 'eng', 'Holy Week - Easter in the Monastery ChurchSunday, 14.04. - Sunday, 21.04.2019'),
('80857ABDACF74CFC8D7225C93EE30E7C', 'ita', 'Dalla fondazione della Collegiata, le grandi feste esprimono il "Mistero della Fede". Nei testi, nei riti e nella musica, la Settimana Santa rappresenta un crescendo che comprende non solo i contenuti della Settimana stessa, ma di tutto l''anno.Per l''anniversario del paese, della Collegiata e quindi anche della musica sacra, il programma del coro delle Collegiata prevede l'' "Hallelujah" di Händel e la "Missa Romantica" di Ulrich Harbecke per soli, coro e orchestra.'),
('D1942E1BAE5D45B5835F6A48C3C6367A', 'deu', 'Noch heute erzählen die älteren Innichner mit großer Begeisterung vom historischen Festumzug vom 14. September 1969. Schon damals wurde in zahlreichen Bildern die Geschichte Innichens von der Besiedelung über die Römerzeit bis hin zur Herrschaft Freisings aufgezeigt.Egon Kühebacher hat ein Konzept erarbeitet, das in 25 Bildern (Festwägen und Fußgruppen) die Geschichte Innichens aufzeigt. Begleitet werden sie von mehreren Musikkapellen. Streckenverlauf: Bahnhofstraße - P. P. Rainer Straße - St. Michaelsplatz - Pflegplatz - Alter Markt - Freisinger Straße - Herzog Tassilo Straße - Draustraße - F. J. Rudigier Straße - St. Michaelsplatz - Pflegplatz - Alter Markt'),
('D1942E1BAE5D45B5835F6A48C3C6367A', 'eng', 'Even today the residents of Innichen/San Candido tell with great enthusiasm of the historic parade of September 14th, 1969. Even then, the history of Innichen was shown in numerous pictures from the settlement over the Roman period to the reign of Freising.Egon Kühebacher has created an concept with 25 pictures (parade floats and groups by foot). The pictures show the history of Innichen/San Candido.Route: Bahnhofsstraße/Via Stazione - P.P. Rainer Straße/Via P. P. Rainer - St. Michaelsplatz/Piazza San Michele - Pflegplatz/Piazza Magistrato - Alter Markt/Mercato Vecchio - Freisinger Straße/Via Freising - Herzog Tassilo Straße/Via Duco Tassilo - Draustraße/Via Drava - F. J. Rudigier Straße/Via F. J. Rudigier -  St. Michaelsplatz/Piazza San Michele - Pflegplatz/Piazza Magistrato - Alter Markt/Mercato Vecchio'),
('D1942E1BAE5D45B5835F6A48C3C6367A', 'ita', 'Ancora oggi gli abitanti di San Candido raccontano con grande entusiasmo della sfilata storica del 14 settembre 1969. Anche allora la storia di San Candido è stata mostrata in numerose immagini dall''insediamento di epoca romana fino al regno di Freising.Egon Kühebacher ha elaborato un programma che, in 25 immagini (carri e gruppi a piedi), rappresenta la storia di San Candido. Il corteo è accompagnato da diverse bande musicale. (Itinerario: Via Stazione - Via P. P. Rainer - Piazza San Michele - Piazza Magistrato - Mercato Vecchio - Via Freising - Via Duco Tassilo - Via Drava - Via F. J. Rudigier -  Piazza San Michele - Piazza Magistrato - Mercato Vecchio)'),
('952A5E52B7814575B6883D4BD46D8610', 'deu', 'Sternwallfahrt aus dem gesamten ehemaligen Dekanat Innichen (Innichen und Sillian) nach Innichen10.00 Uhr: Festgottesdienst zelebriert von Bischof Ivo Muser15.00 Uhr: Feierliche VesperMusikalische Gestaltung: Stiftschor InnichenVorabend: "Fensterbilder", organisiert vom kath. Familienverband, Ortsgruppe Innichen'),
('952A5E52B7814575B6883D4BD46D8610', 'eng', '10 a.m.: Holy mass with the bishop Ivo Muser at the Collegiate Church San Candido/Innichen3 p.m.: solemn vesperMusical accompaniment by the Monastery Church choir Innichen/San Candido'),
('952A5E52B7814575B6883D4BD46D8610', 'ita', 'Pellegrinaggio dell''intero Decanato di San Candido (San Candido e Sillian) a San Candidoore 10: celebrazione della Santa Messa con il Vescovo Ivo Muserore 15: celebrazione del Vespro festivoAccompagnamento musicale: Coro delle Collegiata di San CandidoVigilia: "Immagini alla finestra", organizzato dall''Associazione delle Famiglie Cattoliche San Candido'),
('1AFABFD0152B4F44A07001923A463B3D', 'deu', 'Innichen von der Gründung des Stifts 769 bis ins Hochmittelalter – Historische und kunsthistorische AspekteDas detaillierte Programm finden Sie in der untenstehenden Galerie!'),
('1AFABFD0152B4F44A07001923A463B3D', 'eng', 'Scientific conference at the museum of the Franciscan Monastery (in German and Italian language)'),
('1AFABFD0152B4F44A07001923A463B3D', 'ita', 'San Candido dalla fondazione della Collegiata (769) al Duecento - aspetti di storia e storia dell''arte.Il programma dettagliato della conferenza è visibile nella galleria qui sotto!'),
