('D4673882BBEF41A5AB0EB2836BF5EEEC', 'deu', 'Nach dem Osterfestkreis bilden der Advent und Weihnachten den zweiten großen Festkreis der kirchlichen Feiertage.Alle Gottesdienste im Advent werden mit verschiedenen Vokal- und Instrumentalgruppen musikalisch gestaltet.Sonntag, 01.12.2019, 09.00 Uhr: 1. Adventsonntag - WGF: Kinderchor StiChSonntag, 08.12.2019, 09.00 Uhr: Maria Empfängnis: StiftschorDienstag, 24.12.2019, 16.00 Uhr: Kindermette -WGF: Kinderchor StiChDienstag, 24.12.2019, 22.00 Uhr: Christmette: Stiftschor, Streicher, HausmusikMittwoch, 25.12.2019, 09.00 Uhr: Weihnachtstag: Stiftschor, OrchesterDonnerstag, 26.12.2019, 09.00 Uhr: Stephanstag: Ensemble SaxessenceDienstag, 31.12.2019, 18.30 Uhr: Jahresabschlussmesse: Stiftschor, OrchesterDetailliertes Programm: www.innichen.bz/stiftschor'),
('D4673882BBEF41A5AB0EB2836BF5EEEC', 'eng', 'All the Holy Masses will be accompanied by different instrumental and vocal music groupsMore information: www.innichen.bz/stiftschor'),
('D4673882BBEF41A5AB0EB2836BF5EEEC', 'ita', 'Dopo la Pasqua, l''Avvento e il Natale rappresentano il più importante ciclo di festività. Tutte le Messe dell''Avvento sono accompagnate da diversi gruppi musicali vocali e strumentali.Programma dettagliato: www.innichen.bz/stiftschor'),
