('61C33EF7B5B3428E8CCE0AF0398C5ACB', 'eng', 'Concert for old muisc at the Collegiate Church "Jesu Mi Dulcissime" - Divine Love SongsEnsemble savādi - Kristine Jaunalksne and Ulrike Hofbauer, soprano- Marie Bournisien, baroque harpcompositions of: - Francesco Rasi- Giovanni Girolamo Kapsberger- Francesco Anerio- Christoph Bernhard- Claudio Monteverdi'),
('61C33EF7B5B3428E8CCE0AF0398C5ACB', 'ita', 'MUSICA ESTATE PUSTERIA"Jesu Mi Dulcissime" - Divine Love SongsEnsemble savādi - Kristine Jaunalksne e Ulrike Hofbauer, soprano- Marie Bournisien, arpa baroccaOpere di: - Francesco Rasi- Giovanni Girolamo Kapsberger- Francesco Anerio- Christoph Bernhard- Claudio MonteverdiPrevendita biglietti presso l''Associazione Turistica San CandidoPrezzo: € 15,00 (ridotto € 10,00)'),
('9F4BC17266EE4E16BF26683D26522443', 'deu', 'Muttertagskonzert der Musikkapelle Innichen im Josef Resch Haus in Innichen.Die Musikkapelle Innichen (gegründet 1834) feiert im Jubiläumsjahr das 185. Gründungsjubiläum. Zu diesem Anlass hat Kurt Gäble ein Auftragswerk komponiert, das beim Konzert uraufgeführt wird. Weiters wird die Musikkapelle die neu eingespielte CD vorstellen.'),
('9F4BC17266EE4E16BF26683D26522443', 'eng', 'Mother''s day concert and anniversary concert of the local traditional band of San Candido/Innichen in the Josef Resch Center in San Candido/Innichen.'),
('9F4BC17266EE4E16BF26683D26522443', 'ita', 'Concerto per la festa della mamma della banda musicale di San Candido nel Centro Josef Resch a San Candido.La banda musicale di San Candido festeggia il 185° anniversario della sua fondazione: prima esecuzione della composizione commissionata a Kurt Gäble "Bergwelten" (Mondi montani) e presentazione del nuovo CD.'),
('480D60418C044060B2E593E9EC353797', 'deu', 'Außerkirchl: Truhenorgel (Klop 2003/2017)St. Michaelskirche: Brüstungsorgel (Putz 1630/Pirchner 1997)Stiftskirche: Chororgel (Klop 2014) und Hauptorgel (Putz 1628-1629/Pirchner 2003)Organisten:- Nikita Gasser, Schlägl - Josef Gasser, Wien - Simon Brandlechner, EnnebergEintritt frei'),
