('740AC36DAFA943299353BDE7C0354937', 'deu', 'Im Rahmen des „World Orienteering Day“ findet in Innichen ein Orientierungslauf statt, bei welchem innerhalb einer vorgegebenen Zeit möglichst viele Posten gesammelt werden müssen, die je nach Entfernung und Schwierigkeit unterschiedlich gewertet werden. Die höchstmöglich erreichbare Punktezahl wird natürlich „1250“ sein. Der Wettkampf zählt auch als Etappe des „Puschtracup 2019“, teilnehmen können alle Interessierten jeden Alters.Info: www.haunoldoteam.it'),
('740AC36DAFA943299353BDE7C0354937', 'eng', 'As part of the "World Orienteering Day" in Innichen/San Candido takes place an orienteering in which within a given time as many items must be collected, which are valued differently depending on distance and difficulty.The highest achievable score will of course be "1250".The competition also counts as a part of the "Puschtracup 2019", all interested people of all ages can participate.Info: www.haunoldoteam.it'),
('740AC36DAFA943299353BDE7C0354937', 'ita', 'Nell''ambito del "World Orienteering Day" a San Candido si svolge un orienteering nel quale devono essere raccolti tanti oggetti in un tempo determinato.Il punteggio più alto raggiungibile sarà ovviamente "1250".La competizione conta anche come una tappa del "Puschtracup 2019", la partecipazione e aperta per tutte le fascie d''età.Info: www.haunoldoteam.it'),
('D347ECFF30E042C89EFCE796A95990F0', 'deu', 'Das Seminar geht der Frage nach: „Was hat Tourismus mit christlichen Werten zu tun und welche Impulse könnten sich aus einer positiven Wechselbeziehung zwischen Tourismus und christlichem Glauben ergeben?“'),
