('1DFE16798D85405C8125B607D9F269AA', 'deu', 'Sommersportfest mit Musik, Speis und Trank am neugestalteten Pflegplatz organisiert vom 58. Club Frecce Tricolori Innichen - Pustertal, zu Gunsten der Krebshilfe Hochpustertal.'),
